class EventNotifierProtocol(typing.Protocol):
    pass
# EventNotifier is a Rust-only trait - it's a wrapper around a Rust implementation.
class EventNotifier():
    _pointer: ctypes.c_void_p
    
    def __init__(self, *args, **kwargs):
        raise ValueError("This class has no default constructor")

    def __del__(self):
        # In case of partial initialization of instances.
        pointer = getattr(self, "_pointer", None)
        if pointer is not None:
            _uniffi_rust_call(_UniffiLib.uniffi_pubkycore_fn_free_eventnotifier, pointer)

    def _uniffi_clone_pointer(self):
        return _uniffi_rust_call(_UniffiLib.uniffi_pubkycore_fn_clone_eventnotifier, self._pointer)

    # Used by alternative constructors or any methods which return this type.
    @classmethod
    def _make_instance_(cls, pointer):
        # Lightly yucky way to bypass the usual __init__ logic
        # and just create a new instance with the required pointer.
        inst = cls.__new__(cls)
        inst._pointer = pointer
        return inst



class _UniffiConverterTypeEventNotifier:

    @staticmethod
    def lift(value: int):
        return EventNotifier._make_instance_(value)

    @staticmethod
    def check_lower(value: EventNotifier):
        if not isinstance(value, EventNotifier):
            raise TypeError("Expected EventNotifier instance, {} found".format(type(value).__name__))

    @staticmethod
    def lower(value: EventNotifierProtocol):
        if not isinstance(value, EventNotifier):
            raise TypeError("Expected EventNotifier instance, {} found".format(type(value).__name__))
        return value._uniffi_clone_pointer()

    @classmethod
    def read(cls, buf: _UniffiRustBuffer):
        ptr = buf.read_u64()
        if ptr == 0:
            raise InternalError("Raw pointer value was null")
        return cls.lift(ptr)

    @classmethod
    def write(cls, value: EventNotifierProtocol, buf: _UniffiRustBuffer):
        buf.write_u64(cls.lower(value))

